import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Container, Grid, Typography } from '@mui/material';
import { motion } from 'framer-motion';
import './Home.css'; // CSS file for styles

export default function Home() {
  const navigate = useNavigate();

  const navigateTo = (page) => {
    navigate(`/${page}`);
  };

  return (
    <Container className="home-container">
      <Typography variant="h1" className="home-title">
        Welcome to GlaHarn
      </Typography>
      <Grid container justifyContent="center">
        {['CheckBill', 'Summary', 'StatusDebtor'].map((page, index) => (
          <motion.div
            key={index}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            transition={{ type: 'spring', stiffness: 400, damping: 10 }}
          >
            <Button
              variant="contained"
              className="home-button"
              onClick={() => navigateTo(page.toLowerCase())}
            >
              {page}
            </Button>
          </motion.div>
        ))}
      </Grid>
      <div className="moon-container">
        <motion.img
          src="https://cdn.pixabay.com/photo/2013/07/13/10/35/moon-73728_960_720.png"
          alt="Moon"
          className="moon-image"
          animate={{ y: [0, -10, 0] }}
          transition={{ duration: 3, repeat: Infinity, ease: 'easeInOut' }}
        />
      </div>
      <div className="twinkling-stars" />
    </Container>
  );
}
